import { useEffect, useState } from 'react'
import * as db from './frontend/db'
import * as dbView from './frontend/dbView'
import * as api from './frontend/api'
import * as apiView from './frontend/apiView'
import './App.css'


function App() {
  const [view, setView] = useState()

  const [dbUsers, getdbUsers] = useState()
  const [dbChampions, getdbChampions] = useState()

  const [apiUsers, getapiUsers] = useState()
  const [apiChampions, getapiChampions] = useState()

  async function getChampions(){
    try {
      let response = await fetch('https://ddragon.leagueoflegends.com/cdn/13.16.1/data/en_US/champion.json');
      let data = await response.json();  // Convert the response to JSON
      getapiChampions(data.data);  // Access the 'data' property in the JSON response
      console.log(data.data);  // Log the champions data
  } catch (error) {
      console.error('Error fetching champions:', error);
  }
}
  const [apiItem, setapiItem] = useState()

  useEffect(() => {
    getChampions()
  })

  return (
    <div className='parent'>

      <div className='first'>
        <button style={{ width: '5vw' }} onClick={() => setView('db')}>Database</button>
        <button style={{ width: '5vw' }} onClick={() => setView('api')}>Api</button>
      </div>

      <div className='second'>
        <input style={{ width: '10vw', height: '2vh' }} placeholder="Søk bruker eller Champion" />
        <button style={{ width: '3vw', height: '2.5vh' }}>Søk</button>
      </div>

      <div className='third'>
        {view === 'db' ? <dbView.DbView /> : <apiView.ApiView />}
      </div>

    </div>
  )
}

export default App
